import React, { Component } from 'react';

class Feed extends Component {

  componentDidMount() {

  }

  render() {
    const { data } = this.props;

    return (
      <div className="feed">
        <h1>{data.country}, {data.city}</h1>
        <iframe src={data.src}></iframe>
      </div>
    );
  }
}

export default Feed;
